import React, { useState, useEffect } from "react";

const initialAccolades = [
  {
    year: "2023",
    title: "Most Innovative Tech Startup",
    brand: "TECHCRUNCH",
    img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUlo6YhoGyq6aoKK9oFt7OIGUc_NdAlYUgTQ&s",
  },
  {
    year: "2022",
    title: "Best Security Solutions",
    brand: "CYBERSAFE",
    img: "data:image/jpeg;base64,",
  },
  {
    year: "2025",
    title: "Fastest-Growing Company",
    brand: "CLUTCH 100",
    img: "data:image/jpeg;base64,",
  },
  {
    year: "2025",
    title: "Top Android & Chatbot Development Company",
    brand: "CLUTCH GLOBAL",
    img: "data:image/jpeg;base64,",
  },
  {
    year: "2024-2023",
    title: "Fastest Growing Technology Company",
    brand: "DELOITTE 50",
    img: "data:image/png;base64,",
  },
  {
    year: "2024",
    title: "Fastest Growing AI Development Companies",
    brand: "MOBILE APP DAILY",
    img: "data:image/png;base64,",
  },
  {
    year: "2024",
    title: "Preferred Partner",
    brand: "CIO ASSOCIATION",
    img: "data:image/png;base64,",
  },
  {
    year: "2023",
    title: "Excellence in UI/UX Design",
    brand: "DESIGN AWARD",
    img: "data:image/png;base64,",
  },
];

const AccoladesSlider = () => {
  const [items, setItems] = useState(initialAccolades);
  const [isTransitioning, setIsTransitioning] = useState(false);
  const [direction, setDirection] = useState("next");

  const moveLeft = () => {
    if (isTransitioning) return;
    setDirection("next");
    setIsTransitioning(true);

    setTimeout(() => {
      setItems((prev) => {
        const newArr = [...prev];
        const firstItem = newArr.shift();
        newArr.push(firstItem);
        return newArr;
      });
      setIsTransitioning(false);
    }, 600);
  };

  const moveRight = () => {
    if (isTransitioning) return;
    setDirection("prev");
    setIsTransitioning(true);

    setItems((prev) => {
      const newArr = [...prev];
      const lastItem = newArr.pop();
      newArr.unshift(lastItem);
      return newArr;
    });

    setTimeout(() => {
      setIsTransitioning(false);
    }, 600);
  };

  useEffect(() => {
    const timer = setInterval(() => {
      moveLeft();
    }, 3000);
    return () => clearInterval(timer);
  }, [isTransitioning]);

  return (
    <section className="acc-container">
      <div className="acc-header">
        <h2 className="acc-heading">
          Our Growth Journey As A Mobile App <br />
          Development Company Has Bagged <br />A Few Reputed Accolades As Well
        </h2>

        <div className="acc-controls">
          <button className="acc-arrow" onClick={moveLeft}>
            
          </button>
          <button className="acc-arrow" onClick={moveRight}>
            
          </button>
        </div>
      </div>

      <div className="acc-slider-viewport">
        <div
          className={`acc-slider-track ${
            isTransitioning
              ? direction === "next"
                ? "moving-left"
                : "moving-right"
              : ""
          }`}
        >
          {items.map((item, index) => (
            <div className="acc-card" key={`${item.brand}-${index}`}>
              <div className="acc-icon-box">
                <span className="acc-brand-text">{item.brand}</span>
                <img src={item.img} alt={item.brand} className="acc-card-img" />
              </div>
              <div className="acc-card-footer">
                <p className="acc-year">{item.year}</p>
                <h4 className="acc-card-title">{item.title}</h4>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default AccoladesSlider;
